DROP TABLE IF EXISTS countries;
CREATE TABLE IF NOT EXISTS countries(
   LAT        NUMERIC(11,7) NOT NULL
  ,LON       NUMERIC(11,7) NOT NULL
  ,DMS_LAT    INTEGER  NOT NULL
  ,DMS_LON   INTEGER  NOT NULL
  ,MGRS       VARCHAR(16) NOT NULL
  ,JOG        VARCHAR(8)
  ,DSG        VARCHAR(5) NOT NULL
  ,AFFIL      VARCHAR(2)
  ,FIPS10     VARCHAR(2) NOT NULL
  ,SHORT_NAME VARCHAR(40) NOT NULL
  ,FULL_NAME  VARCHAR(53) NOT NULL
  ,MOD_DATE   DATE  NOT NULL
  ,ISO3136    VARCHAR(2)
);
